import { CustomNavBar } from "@/components/custom-navbar.component";
import { CategoryService } from "@/services/ category.service";
import { jsPDF } from "jspdf";
import { useRouter } from "next/navigation";
import { useEffect, useState } from "react";
import Cookies from 'js-cookie';
import Image from "next/image";
import "../app/assets/styles/public.css";
function CourseComplete(){
    const router = useRouter();
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [categoryService] = useState(new CategoryService());
    const [categories,setCategories] = useState([]);

    useEffect(() => {
        if (typeof window !== "undefined") {
            const token = Cookies.get("token");
            setIsAuthenticated(token !== null);
        }
            categoryService.getCategories().then((response: any) => {
            setCategories(response.data);
        });
    }, []);

    function generatePDF() {
        const doc = new jsPDF({ orientation: "landscape" });
      
       
        doc.setFillColor(255, 255, 255);
        doc.rect(0, 0, doc.internal.pageSize.getWidth(), doc.internal.pageSize.getHeight(), 'F');
      
        const pageWidth = doc.internal.pageSize.getWidth();
        const pageHeight = doc.internal.pageSize.getHeight();
        doc.setFillColor(135, 206, 235); 
      
        doc.circle(20, 10, 15, 'F'); 
        doc.circle(pageWidth - 20, 20, 15, 'F'); 
        doc.circle(20, pageHeight - 20, 15, 'F');
        doc.circle(pageWidth - 20, pageHeight - 20, 15, 'F'); 
      
    
        doc.setFontSize(30);
        doc.setTextColor(0, 0, 0);
        doc.text("Curso Completado", 10, 35);
        const imgData = "data:image/jpeg;base64,";
        doc.addImage(imgData, "PNG", 10, 40, 150, 100);
        const date = new Date();
        doc.setFontSize(15);
        doc.text("Este certificado acredita que", 150, 50);
        doc.text("ha completado el curso de", 150, 70);
        doc.text("Introducción a la programación", 150, 90);
        doc.text("Firmado por: Juan Perez", 150, 110);
        doc.text("Director de Handing", 150, 130);
        doc.setFontSize(10);
        doc.text(`Fecha de emisión: ${date.toString()}`, 150, 150);
      
        doc.save("certified.pdf");
      }
      
    return (
        <div className="ml-10 flex flex-col gap-15  page-size">
            <CustomNavBar categories={categories} isAuthenticated={isAuthenticated} />
             <div className="mt-10 lg:mt-28 flex justify-center lg:justify-between flex-col lg:flex-row">
                <div className="flex flex-col justify-center p-20 text-sky-500">
                    <h1 className="font-semibold  text-5xl lg:text-7xl"> Felicidades!! </h1>
                    <p className="text-3xl lg:text-5xl">Has completado el curso con éxito</p>
                </div>
                <div></div>
                <Image  src={"https://ceprofesional.com/wp-content/uploads/2022/06/curso-completado.png"} alt={"Congratulations image"} width={800} height={300}/>
             </div>
            <button className="bg-sky-500 text-white p-3 w-48 rounded-xl hover:cursor-pointer hover:scale-110 m-auto xl:ml-44 mt-10 lg:mt-0" onClick={generatePDF}>Generar Certificado</button>
        </div>
    )
}

export default CourseComplete;